import { Link, useLocation } from 'react-router-dom'
import MenuLink from '../MenuLink'
import styles from './Menu.module.scss'

export default function Menu() {
	const menus = [
		{
			children: 'Home',
			to: '/'
		},
		{
			children: 'About Me',
			to: '/aboutme'
		}
	]

  return (
    <header>
        <nav className={styles.nav}>
          <MenuLink menus={menus} />
        </nav>
    </header>
  )
}
